import "./App.css";
import ImageSlider from "./components/ImageSlider";
import { SliderData } from "./components/SliderData";

function App() {
  return (
    <div className="App">
      <img src="https://i.imgur.com/1ZQ3Q2M.png" alt="logo" className="Logo" />
      <header className="App-header">
        <p className="Title">
          {" "}
          You may ask why should Barbara go on a date with me. Use the arrow
          keys to right or left to know more about.
        </p>
        <ImageSlider slides={SliderData} />;
      </header>
    </div>
  );
}

export default App;
